import React from 'react';

interface MyComponentProps {
  imageUrl: string;
  onButtonClick: (buttonIndex: number) => void;
}

const MyComponent: React.FC<MyComponentProps> = ({ imageUrl, onButtonClick }) => {
  const handleButtonClick = (buttonIndex: number) => {
    onButtonClick(buttonIndex);
  };

  return (
    <div>
      <img src={imageUrl} alt="Imagem" />
      <button onClick={() => handleButtonClick(1)}>Botão 1</button>
      <button onClick={() => handleButtonClick(2)}>Botão 2</button>
      <button onClick={() => handleButtonClick(3)}>Botão 3</button>
    </div>
  );
};

export default MyComponent;
